{"version":3,"sources":["../../src/server/node-polyfill-crypto.ts"],"sourcesContent":["// Polyfill crypto() in the Node.js environment

if (!global.crypto) {
  let webcrypto: Crypto | undefined

  Object.defineProperty(global, 'crypto', {
    enumerable: false,
    configurable: true,
    get() {
      if (!webcrypto) {
        webcrypto = require('node:crypto').webcrypto
      }
      return webcrypto
    },
    set(value: Crypto) {
      webcrypto = value
    },
  })
}
